import { StyleSheet } from 'react-native';

const styles = () => {
  console.log('styling...');
  StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',
      alignItems: 'center',
      justifyContent: 'center',
    },
  })
};

export default { styles };
